import { TABS } from "../../constants/constants";

import "./style/index.css";
import "./style/swipeCard.css";
import "./stylchatBox.css";

export default function Header({
  displayProfilePic,
  handleClick,
  tab,
  handleLogOut,
  handleChangePreference,
}) {
  return (
    <div className="header">
      <div className="userimg">
        <img src={displayProfilePic} alt="" className="cover" />
      </div>
      <ul className="nav_icons">
        <li>
          <ion-icon
            iconName="filter"
            name="filter-outline"
            onClick={handleChangePreference}
          ></ion-icon>
        </li>
        <li>
          <ion-icon
            iconName={TABS.PROFILE}
            name={tab === TABS.PROFILE ? "person-add" : "person-add-outline"}
            onClick={handleClick}
          ></ion-icon>
        </li>
        <li>
          <ion-icon
            iconName={TABS.CHATS}
            name={tab === TABS.CHATS ? "chatbox" : "chatbox-outline"}
            onClick={handleClick}
          ></ion-icon>
        </li>
        <li>
          <ion-icon
            iconName="logout"
            name="log-out-outline"
            onClick={handleLogOut}
          ></ion-icon>
        </li>
      </ul>
    </div>
  );
}
